INSERT INTO `issues` (`id`, `projectId`, `userId`, `name`, `units`, `description`, `issueOrderNum`) VALUES
(91, 8, 20, 'Resolving Heterogeneity of Data', 'data types', 'An basic obstacle to transformation of data into value would be resolving the heterogeneity of data.', 1),
(92, 8, 1, 'degree of openness or open source', 'Julianna Rotich, Esra Al Shefei, Erik Hersman, Ramana Rao, Jean-Baptiste Michel, Walid Al Saqaf, Emeka Okafor', 'open source was a huge enabler for Ushahid to get where it is by enabling collaborative innovation on a budget.  Same is true in the Middle East Arab Spring to enable access to the basic tools that allows others to build on them on a tight budget. Open source enables not just innovation but also local cultural relevancy to different people with different needs. It allows the tools to adapt to local needs. Perhaps as more companies see the benefits of open source, this will start to erode the foundation of copyright protection of data – it will enable or incentives corporations to be more open about data', 2),
(93, 8, 1, 'ability for people to derive immediate utility from data', 'Julianna Rotich, Emeka Okafor', 'A tight feedback loop of engagement is key. Not just data for data''s sake, but there must be an way for people to immediately see the utility of data for their needs. The idea of open data or vibrant data is a huge abstraction for many people. The only way for it to evolve is if people can see examples that illustrate how they can directly and immediately benefit them.', 2),
(94, 8, 1, 'ability to bridge language barriers', 'Julianna Rotich, Esra', 'Ability to easily translate platforms, tools, and internet content into multiple languages is key for success in different contexts and places. This was key for anti-censorship tools in the Middle East to be accessible to arab speakers. Or for Ushahidi to be successful in Latin America.', 3),
(95, 8, 1, 'access to tools for collaboration', 'Julianna Rotich', 'To make opennes useful, it''s essential to have tools that enable collaboration - tools that bring people together not just to collect data together but to finding meaning in the data.', 4),
(96, 8, 1, 'rewards for collaboration', 'Julianna Rotich', 'to enable collaboration - need incentives. either social relationships, or money, or other rewards - for example giving phone credit to people to send in good information.', 5),
(97, 8, 1, 'degree to which the participants have a shared problem', 'Julianna Rotich', 'building communtiy around shared probs and solutions - if they share the problem then they are more incentivized to collaborate.', 6),
(98, 8, 1, 'security of sensitive data (anonymity?)', 'Julianna Rotich', 'For crowd-sourced data, there is a challenge to protect anonymity in politically sensitive applications. For example in Egypt or in Syria where people are reporting violence. Collaborative platforms need an easy way to securely store information', 7),
(99, 8, 1, 'flexibility to apply a given platform to meet local needs', 'Julianna Rotich', 'the platform is only 10% - the rest is how it is used given the location, the tech limitations, and the problem.  each requires now an initial amount of hand-holding to teach people how to best apply the platform - barriers to entry are about how to use it for my needs.  if there were a general framework for helping people by identifying in context A for problem B, here is how you use the platform.  how best enable one platform for heterogeneous use.', 8),
(100, 8, 1, 'political censorship', 'Julianna Rotich, Esra', 'Censorship is a huge barrier to not just communication, but for the ability of people to see broad patterns relevant to them. It can be enhanced by open source platforms because they are easier to find loopholes for censorship', 9),
(101, 8, 1, 'availability of automatic translation tools', 'Julianna Rotich, Walid Al Saqaf', 'reaching people in multiple nations requires translation, and sometimes that is too much content to do individually. For example a large proportion of basic information on the web is not accessible to Arab speakers.', 10),
(102, 8, 22, 'Patient privacy', 'optional', 'Patients are afraid that if their data (medical data, genotypic info, etc) is in the wrong hangs, they will be denied job opportunities, health insurance coverage, etc.', 1),
(103, 8, 22, 'Competitive advantage', 'optional', 'Corporations by sharing their data lose the competitive advantage they have on other companies for research or business success.', 2),
(104, 8, 22, 'Errors in data', 'optional', 'Some stakeholders are afraid of releasing data in the fear that mistakes they have made in the compilation, gathering, and interpretation of the data may be found to be mistaken.', 3),
(105, 8, 22, 'Lack of Common language', 'optional', 'Even in gene info, while many databases share info, they are in different formats without specific unifying identifiers. Translation and conversion becomes difficult.', 4),
(106, 8, 22, 'Control of data', 'optional', 'There needs to be careful security and control of data so it will only end in individuals who have authority to use it instead of going into the wrong hands.', 5),
(108, 8, 25, 'Amount of personal data collected', 'Gbytes (?)', 'How much personal data is collected?', 2),
(109, 8, 25, 'ease of personal data collection', '', 'How easy is it for people to collect data about themselves or their environnment? What are the "costs" (time, effort, equipment, etc.) associated with personal data collection?', 3),
(110, 8, 25, 'availability of storage', 'Gbytes', 'Basic but important: how much storage is there? (A spin on this is where is the storage located, locally or "in the cloud''?)', 4),
(111, 8, 25, 'Openness of data storage / architecture', '', 'How open and accessible is data to people? Is it locked down in a proprietary database or somehow put ''in circulation"?', 4),
(112, 8, 25, 'data security', '', 'How secure is personal data from misuse? Obviously it can''t be locked down and hidden away if it is to be open to new kinds of analyses, etc., but how do we prevent misuses of other people''s data?', 5),
(113, 8, 25, 'data standardization and interoperability', '', 'How likely are two data elements / data sets to interact? Do they require lots of "scrubbing" and normalization, or can they be made to interact more easily?', 6),
(114, 8, 25, 'data self description / self disclosure', '', 'How well does a given data element, or data set, describe its own contents (through meta-tags or other means)', 7),
(115, 8, 25, 'ability to request / buy or offer / sell data', '', 'What means do people have to request or offer data for different purposes? How will exchanges take place, including the transfer of value as well as data?', 8),
(116, 8, 25, 'value accrual capability and representation', '', 'How can we enable people to accrue and track value associated with the offering of personal data, or the development of new analytics or other ways of contributing to these networks? How will value be represented? What are the appropriate units ($, social capital, etc)', 9),
(117, 8, 25, 'ease and accessibility of analytics', '', 'new tools for analytics must be developed that enable people without highly specialized skills to look at data and extract new meaning. This probably means new visual analysis tools and other kinds of tools as well', 10),
(118, 8, 26, 'Statistical use of the web', '', 'As a user, it would be truly great to know how often I visit different websites and for how long I stayed on those website. This would help me understand how much time I dedicate to education websites, to scientific journals, to news, to social networking sites, etc. and would hence point out any changes that I need to apply to use my time more constructively. This is also useful for parents who wish to monitor their kids'' usage of the Web', 1),
(119, 8, 26, 'Censored websites in your environment', '', 'An increasing number of countries are applying filtering to websites on a nation-wide level, causing a skew to information accessibility. Examples are the Great Firewall of China, Iran''s firewall, Syria''s firewall, etc. And it would be of great use if users are provided with this information so they know that information they are trying to access within their environment is blocked by their firewall/ISP.', 2),
(120, 8, 26, 'Customized service information based on geographical location', '', 'Supposed you are living in downtown Seattle, it would be great if the user could have a series of government services offered within that geographical location. The service''s value would be higher for countries/cities that have fewer online resources that offer such data.', 3),
(121, 8, 27, 'Inteligibility of data', '', 'Math may be the universal language, but few individuals have the skillset to look at data and find meaning. So, simply opening up the availability of more data will not lead to greater insight on it''s own. There are two solutions to this problem, but both have their own pitfalls.\n\nFirst, people can be better educated on how to interpret data. This is probably important, but it can''t be the whole answer, since more specialized, useful datasets (like medical records, patent publication histories, or energy usage) require different, specialized skillsets to interpret.\n\nSecond, better tools can be developed to assist in the translation of data into meaning. This will likely be the larger part of the solution, since tools can be designed to leverage a common skillset, while giving specialized insight on a variety of data types. However, there is an inherent tendency against usable tool development, because tools require skilled experts to develop, and these skilled experts, by creating tools, tend to reduce their own value -- they are designing away their own jobs.', 1),
(122, 8, 27, 'Contextual relevance of data', '', 'Data is only relevant when embedded in a context. And, often, the context in which data is known or collected is not one where that same data is valuable. For example, most of the remaining understanding of naturally derived fibers, gums, resins, and glues exist as oral traditions among relatively low-technology populations around the world. These materials could enable new classes of manufacturing if they could be combined with CNC or robotically actuated fabrication techniques, but usually populations living in a context which have access to robotic fabrication technologies have progressed down a development path which abandoned oral traditions of useful plants and non-synthetic feedstock materials.\n\nThus, it is crucial that any data management system do some sort of cross-pollination work, particularly if it is desirable to have novel functionality emerge from the interaction.', 2),
(123, 8, 27, 'Sensor Accessibility', '', 'Data doesn''t come out of nowhere. Many people have access to data storage and sharing through the internet. Some of these people have access to some sensors through their smartphone or laptop (GPS, temperature, acceleration, etc). But the really interesting data like exposure to various types of radiation, or presence of specific chemicals are still out of reach of most casual users. \n\nA recent demonstration of the need for this sort of information is the aftermath of the Fukishima nuclear disaster in japan. Until these sort of data can be gathered by more people, it won''t be possible to really execute the type of broad analysis of the effects of this disaster. And problems like this exist in many domains.', 3),
(124, 8, 27, 'Data Portability', '', 'The systems used to analyse data are only as useful as the data that can be fed into them. Unfortunately, the data we collect is rarely formatted to some universal standard. Instead, hundreds of different data systems each offer their own semi or fully proprietary format of data storage, which leads to the need for cumbersome translation of data, and sequential corruptions of datasets as it is translated from one standard to another.\n\nBetter standards setting will help to solve this problem, but it seems unlikely that the world will ever really agree on few enough standards to fully solve the problem. \n\nInstead, better automated translation systems are probably the answer. In order for this to really work, it seems like translators will need to more fully understand the content that they are translating. This is a challenge, and semantic web researchers are taking it on now, along with others.', 4),
(125, 8, 27, 'Scalar variability of data utility', '', 'Just as cultural and geographic context can alter the utility of data, so too can viewing a system at different scales. For example, at the atomic level, matter can be described with simple variables involving mass, inertia, temperature, energy, charge, etc. Jumping out to the galactic scale, these same variables are valuable, and can fully describe interactions.\n\nBut in the middle, these simple variables fade in importance, relative to other variables which depend on the scale at which we are viewing the system. Cellular behavior is governed by the interactions of proteins and DNA. Behavior of organs can be expressed in terms of complex organic chemistry. Organisms (collections of organs) act according to different chemical pathways, and also involve more gross measurements like calorics and neuro-chemistry. Some of these organisms have neural organs which allow for self-awareness or conciousness, and these express thought and behaviors which can be measured. When multiple sentient organisms interact, descriptions of social behaviors, or even culture are valuable. Some of these societies develop technologies, which come to characterize and predict their group behavior. When classes of organisms interact with one another, in competition and synergy, ecologies can develop, which require new measurements. And, finally, when culture, ecologies, geology, geography, and technology all are taken together, we see the sort of planetary-scale systems that give rise to issues like global warming, ocean acidification, and topsoil loss.\n\nThe challenge here is that to understand each of these scales of interactions, a new suite of data is needed, along with the relevent schema by which to inter-relate these data to give a picture of the behavior of the system. On some level, it is necessary to share not only the data, but also the scheme by which to understand that data. \n\nThis same problem presents itself in microcosmi as well -- take medicine: Cancer research is being pursued at multiple scales. Chemotherapy acts on the basic chemical pathways used by cells. Gene therapy seeks to intervene within the cellular machinery itself. Supportive therapies act on the body''s immune system to alter it in a way that can better attack the cancer. Cryo-therapy and Gamma-knife techniques act to physically remove tissues, but must not dammage the rest of the body in the process. And lastly, epidemiologists work from the society in, trying to change group behaviors to minimize exposure to cancer-causing agents.\n\nAll of these researchers could benefit from the understanding that the other have, but this understanding is not simply contained in the data, but also in the structure, or schema given by those researchers to the data as they work on it.', 5),
(126, 8, 29, 'Simplicity', '', 'Anything that is not simple in todays digital world, will be difficult to gain viral spread. If the process of inputting data is remotely more challenging than the ease at which we do so now, I feel people will opt for the easier method UNLESS they realise  tangible value and immediate value from doing so. As such the value of decentralisation will drive the success of adoption.', 1),
(127, 8, 29, 'Security', '', 'Decentralization of data raises issues of security which could be a constraint going forward. How secure is my personal data really.? Knowing your personal data is out there in the wide open seems riskier than not knowing where it has gone!', 2),
(128, 8, 29, 'Trust', '', 'There must be a huge element of trust in any decentralised system for it to work.', 3),
(129, 8, 29, 'Liability', '', 'What if something goes wrong? Who takes liability? What if my personal data is used in a detrimental way?', 4),
(130, 8, 29, 'Sensitive and confidential data', '', 'I imagine not all personal data should be decentralised as some data is not only sensitive but also confidential .', 5),
(131, 8, 28, 'Sensors / Hardware availability/suitability', 'Cost of sensing technologies, how widely they are deployed, economic value of the data they collect', 'The sensors in smart phones have transformed the very metrics surrounding the data we collect, yet in spite of this there are many obstacles that prevent sensor networks from being deployed in other settings.  Because of this, certain types of information - whether they be environmental data or specialized computer vision data - remain the exclusive domain of large and well funded organizations.  It is not very well understood how much value cheaper sensors create in our daily lives and in global markets - if we could better connect this impact with sensing technologies, on both a social and economic level, we might create more demand for innovation in hardware.  \n\nAs the recent boom of personal exercise sensors (fitbit, nike fuel, up) has shown, cheap sensors have the ability to facilitate the creation of entirely new datasets, and if we understood the role they play in driving the generation of newer, more targeted datasets we might create devices that address social problems that would otherwise remain difficult to quantify.', 1),
(132, 8, 28, 'WIreless infrastructure / ISP subscription models', '', 'Current subscription models for data access severely limit the amount of devices any individual will connect outside of their home/work networks.  In contrast, when data access is something integrated into a product (ie Kindle 3G, Qualcomm''s mobile health initiatives) a very different information ecosystem can exist alongside smartphones.  If it were possible for more organizations to utilize connectivity in this fashion we''d be able to launch more projects to monitor more aspects of everyday life.  So many of the things we expect to be smart (public transportation, traffic systems, inventory tracking) could benefit from such an arrangement because registry of devices would no longer be the responsibility of the end user.', 2),
(133, 8, 28, 'End user license agreements', 'universal/customized privacy preferences', 'We have standards for determining software compatibility (ie some programs won''t install on the wrong systems) but we don''t have standards for determining privacy/control compatibility with an end user.  If we could customize what types of agreements we are simply unwilling to agree to, filtering out bad privacy policies while simultaneously allowing organizations to quickly poll what agreements groups of people are open to considering, it might encourage development of better systems that are more responsive to a user''s or a community''s needs.  Legal agreements are not all that different than API''s and requiring an entity to meet our requirements would liberate many of us to share more freely, collaborate more often, and collectively organize in new ways.\n\nTo secure trust one would likely need such a system to be backed with legislation, yet when Australia is in the process of defining digital rights to identity and creating a national system to protect its citizens online, it''s clear that government might be able to play a productive role in facilitating a much needed transition.', 3),
(134, 8, 28, 'Tools for self-experimentation & self-understanding', 'i assume this would require a tagging/markup language to be implemented universally', 'One feature on facebook is particularly useful is one''s ability to verify privacy preferences by viewing one''s information from the perspective of specific individuals in one''s social network.  It allows one to quickly absorb the real-world implications of a given preference and to better understand what possibilities exist.  It''s not perfect but it points to a more visceral possibility for someone to understand their relationship to their own personal data.  If I had access to a tool that would put things in context by using my own data (for my eyes only) I would probably develop a much better understanding of my online self and the ways in which policies impact me personally.  For instance, if an employer adopted a new twitter policy that held employees personally liable for things they say, employees would have far more control/understanding of the implications if a filter could identify through sentiment analysis existing tweets that might violate the future terms.  At some level this is what the SOPA blackout performed by giving the world a preview of what the law would do to the open web - such examples are powerful, and if we could tweak them to show a customized view of our own lives we''d gain a more visceral understanding of the ecological implications of openness and privacy.', 4),
(135, 8, 28, 'User friendly metric translators for dataset interoperability', 'statistical API tagging structure...', 'Incompatible metrics make it impossible to compare many datasets, and this inhibits a process of discovery that many users would love to embark upon.  Wolphram Alpha offers a very fascinating way to answer questions and make comparisons, but there''s no way to introduce new data into the equation and if your question lies outside what they''ve preformatted you''re out of luck.   In many cases we simply need translation utilities designed to convert one metric into another - statistical API''s in a sense.  Not a simple task, but one that if framed properly could unite the best aspects of wikipedia with the best aspects of github.', 5),
(136, 8, 24, 'visualization', '', 'The availability of large quantities of data isn''t directly very useful to the general public unless there exist powerful and easy to use tools to translate that data into compelling images and animations that tell a story. A key challenge is how to create those tools such that they help citizens answer questions they are interested in. A related challenge is how to ensure that those tools avoid distorting the truth or unintentionally creating misleading results because they are simply too difficult to use.', 1),
(137, 8, 24, 'database authorship', '', 'Citizens should be able not just to interpret existing data but also to propose new types of data to collect. Inherent in this process of data collection are various technical issues related to data formats, consistency, units and so on. Software tools could help abstract away some of these technical issues so that those without expertise in database design could still design and create mechanisms for collecting and interpreting data they are interested in.', 2),
(138, 8, 24, 'privacy', '', 'As access to data increases, the privacy issues surrounding it become more complex. While many large organizations that manage public data have implemented privacy policies, the same does not hold true for individuals.', 3),
(139, 8, 24, 'mobile sensors', '', 'Small, powerful microprocessors with low cost and low power consumption are making it possible to create devices that collect data in new ways. For example, researchers have created mobile air quality sensors to map out the pollution in a space by correlating air quality measurements with GPS readings on devices worn by people living in the area of interest. This is just one example of how new kinds of sensors can help us generate and analyze new kinds of data.', 4),
(140, 8, 24, 'interpretation', '', 'Often statistics generated from data can tell a misleading story, either accidentally or by design. Given that many people who might want to explore complex datasets might not have the necessary statistics training to understand these issues, is it possible to build software tools to help people understand the statistical validity of conclusions suggested by data analysis?', 5),
(141, 8, 24, 'veracity', '', 'When data is collected from the public, there may be a risk that the data can be manipulated by an entity with an ulterior motive. For example, if a group of citizens set up a website allowing people to submit neighborhood air quality readings, it might be difficult to detect or stop someone from submitting false data, for example to conceal the effects on air quality of a factory that was putting out a great deal of pollution.', 6),
(142, 8, 25, 'analytics tools', '', 'how good are the analytics tools? how many kinds of analytics tools are there, and how diverse are they? What tools do people have to find new meaning in available data?', 11),
(143, 8, 25, 'ease of discovery', '', 'this issue deals with the question of how well people are able to find data and data sets. Do they have to search? Does data "find itself"?', 12),
(144, 8, 25, 'Number of people participating', '', 'The sheer number of people participating is obviously a factor', 13),
(145, 8, 25, 'metadata plasticity', '', 'How easily can metadata or descriptions of data be changed, updated or mutate to reflect new information in the system?', 14),
(146, 8, 25, 'data plasticity', '', 'How easily can data be changed, added to, or mutate? Might make a difference in terms of how "vibrant" the system emerges to be, because it opens it up to evolution and change.', 15),
(147, 8, 25, 'Number and variety of inputs', '', 'What are the various sources of data? How large is this number? Is there a critical threshold, when you pass it, that there is an explosion in the availability of data?', 16),
(148, 8, 25, 'ability to discover correlations', '', 'How easy are correlations in the data to discover? What tools are available? Will such correlations be discovered by people, or algorithms? How will discoveries be communicated?', 17),
(149, 8, 25, 'ability to normalize / clean / index data', '', 'How easy is it to clean and organize and index data? How will this organization happen, via human intervention or through algorithms or other means?', 18),
(150, 8, 1, 'ability to be locally relevant', 'Julianna Rotich, Erik Hersman', 'A challenge is enabling low barriers to access in different countries. Each situation is different.  The needs and methodologies for engagement differ among communities and problems (e.g., crisis mapping vs political elections). The local technologies dictate constraints or opportunities. For example, in many places the primary mode of communication is basic SMS not smartphones or laptops.', 11),
(151, 8, 1, 'cost of computation', 'Bill Joy, Omar Wasow', 'extremely cheap and smaller computational power is critical to the proliferation of small sensors, and the ability to generate and process data on mobile devices', 12),
(152, 8, 1, 'amount of data open and accessible', 'Bill Joy', 'state variable', 13),
(153, 8, 1, 'ability to put individual events into a broader context', 'Bill Joy', 'One huge value of big data or open data is the ability to see broad patterns and put events or individuals into a broader context. To see ''where am i?'' in a broader context. For example, this was a huge enabler of the Arab Spring - to let people realize that they were not alone in their feelings so they had security in numbers. It helps people make decisions about what is the typical price of something in location X, etc.', 14),
(154, 8, 1, 'increased human well-being', 'Bill Joy', 'key higher level goal of the Vibrant Data Ecosystem', 15),
(155, 8, 1, 'proportion of the population with basic data literacy', 'Bill Joy, Jon Gosier, Graham Hill, Omar Wasow, Walid Al Saqaf, James Patten, Ramana Rao', 'Basic data literacy is at minimum the ability to take two pieces of information together and find new meaning.', 16),
(156, 8, 1, 'proportion of the population with statistics literacy', 'Eric Berlow, Graham Hill', 'not sure if this needs to be separate from ''data literacy'' - but it refers to basic critical thinking skills around drawing inferences and conclusions from patterns in the data', 17),
(157, 8, 1, 'discrimination against people or groups of people', 'Bill Joy, Omar Wasow', 'Even if your personal information is aggregated, it''s possible to identify you and use that to discriminate against you. For example, in health care it can be used to exclude people from getting insurance because of inferences that they either have or are likely to have a disease.', 18),
(158, 8, 1, 'ability to prevent disease', 'Bill Joy', 'access to more information and patterns could help identify patients who could easily improve their health.  Most of the health improvement in the 20th century was from prevention – clean water, vaccines, etc - So we could have a new era of prevention based on access to broad patterns and predictive associations.', 19),
(159, 8, 1, 'ability to find relevant meaning in a sea of data', 'Bill Joy, Julianna Rotich, Ramana Rao', 'A big challenge is how to deal with the deluge of data and enable people to find things that are immediately relevant to them.  Even for small organizations it is a challenge without a big budget.  On the one hand this is the ability to answer specific questions with data, but also to have patterns in the data spark questions that people didn''t know they had, but that are meaningful to them.  Data play. Related to data literacy, but more advanced in the context of an overabundance of data.', 20),
(160, 8, 1, 'cost of networking and storage', 'Bill Joy', 'People underestimate the power of the reduction in cost of computing, networking and storage. Soon things that we normally think of as in the realm of business (because of high overhead costs) won''t have to be business. If you wanted to make an open source Facebook that was owned by nobody and was basically free, and the public radio over a version of a commercial endeavor, it will be possible at low cost.', 21),
(161, 8, 1, 'ease with which micro-entrepreneurs can enter the market', 'Bill Joy', 'Vibrant Data accessible through a small mobile device greatly lowers the barriers to entry for micro-entrepreneurs. The smart-phone can now be used to take a credit card, and you can do banking right there. Access to real time market information, like the price of pigs in the village down the road, will greatly enable this process of every-day entrepreneurs.', 22),
(162, 8, 1, 'distributed access to real time market data', 'Bill Joy, Jimmy Lin', 'The ability to access market data in real time - like the price of pigs at the village down the road, is a huge enabler of micro-entrepreneurs', 23),
(163, 8, 1, 'ability of small entrepreneurs to avoid getting scammed', 'Bill Joy', 'With more information, it’s easier to find out information about people to know if you can trust them.  More transparency allows for accountability in this context.', 24),
(164, 8, 1, 'government transparency', 'Graham Hill', 'Ability to expose information buried in government databases and let the crowd find meaning in it.', 25),
(165, 8, 1, 'ability of non-experts to find meaning in data', 'Graham Hill, Jon Gosier, James Patten', 'Ease of access to data analysis, data visualization, and data mining to non-experts.', 26),
(166, 8, 1, 'ability of small entrepreneurs to set a fair price', 'Graham Hill, Jimmy Lin', 'open data and access to trends and geographic patterns allows small entrepreneurs and local farmers to figure out what price to charge without having a huge market research team, etc.', 27),
(167, 8, 1, 'incentives for large companies to share data', 'Jimmy Lin, Jean-Michel Baptise', 'There are signs of individuals within companies trying to use people data for social good, but there are no larger incentives for the companies to do so. Never before in human history has so much information about civilians been held by private enterprises.', 28),
(168, 8, 1, 'degree of vulnerability of open source community to malicious users', 'Jimmy Lin', 'In open source computing and open data, a big challenge is creating a culture of goodwill that prevents cheaters and impacts of malicious users who want to break the system or take advantage of it.', 29),
(169, 8, 1, 'individual accountability', 'Jimmy Lin', 'the more people have access to our personal data, the more accountable we are for our actions? accountability is the flip side of privacy invasion.', 30),
(170, 8, 1, 'ease and speed of interacting with data to answer questions', 'James Patten, Ramana Rao', 'the only way to begin to make sense of huge data sets is to be able to iteratively ask questions and discover patterns that spark new questions. so a key consideration is how do we interact with those data? how do we perform experiments with the data? How do we come up with an idea, of well I think that maybe this is true. Well let me see if that’s actually true. So the faster, the faster and easier it is for someone to actually interact with data, the better theyre going to be at understanding what that data actually means.', 31),
(171, 8, 1, 'number of human senses engaged to answer questions with data', 'James Patten', 'Physical interaction with data. It’s possible to engage all of our senses not just vision but all of our senses and when we start doing that then it becomes much easier for people to develop a rich sense of what’s going on and with the data that theyre trying to understand. Using physical objects to represent, to control that  data and ask questions.', 32),
(172, 8, 1, 'personal security', 'James Patten', 'May actually enabled by more bringing data into the physical world – it’s less abstract and people understand better how to secure physical things. 	This is one case where ease of use and security does not have to be a trade-off', 33),
(173, 8, 1, 'efficacy of transportation', 'James Patten', 'One of the main problems with public transportation  systems now, is a a lack of well digested info about where different modes of  transportation are. What’s the most efficient way to get across the city. We have systems like google maps but the answers aren’t the best answers. How do you provide quick information about the optimal way to get somebody from point a to point b within a city you know, so fast they wont, they wont want to take a car because  the car will be so much slower than the alternative', 34),
(174, 8, 1, 'accuracy and reliability of real time information', 'James Patten', 'Transportation example. Distributing this information to a mobile phone and having apps on that phone that can make really intelligent decisions based on historically how accurate have predictions been in terms of travel times. It''s different than what''s happening now in that the more data available, the more we can make statistical predictions to give answers that are more useful and more accurate, and things that people will actually trust', 35),
(175, 8, 1, 'platforms that enable access to multiple data streams', 'James Patten', 'Even with data that are available, often there is no way to see different types of data in one place to compare. So for example in transportation, where are all the buses, all the taxis, all the subway trains, all the traffic - all in real time.', 36),
(176, 8, 1, 'ability for entrepreneurs to find needs that are not being met', 'James Patten', 'Data from either sensors or crowd input can help identify where needs are not being met - where are the potholes, where is there a gap in public transit, etc. which can provide opportunities for small entrepreneurs to fill the gap.', 37),
(177, 8, 1, 'efficacy of transporting goods', 'James Patten', 'using data to understand how people and goods are moving in cities to make it more efficient by enabling opportunities for middle-people and small entrepreneurs', 38),
(178, 8, 1, 'user interfaces that allow non-experts to intuitively interact with data', 'James Patten, Jon Gosier, John Batelle', 'To have democratic access to data, it must be extremely intuitive and gesture based to understand so we can interact with data rather than think too hard– Non-experts need to be able to intuitively ask questions of the data without thinking much about what is going on behind the scenes – Much like the Google search box allows us to follow our questions without thinking about what is happening behind the scenes.  The key to enabling access  to data for non-experts is UI', 39),
(179, 8, 1, 'passive data literacy', 'Jon Gosier', 'Just by enabling intuitive exploration of data, people will become more data literate without realizing it. Just like people have become digitally literate by using well designed software. The more passive is this education, the more it will enable Vibrant Data', 40),
(180, 8, 1, 'ability of general public to find meaning in large data sets', 'Jon Gosier', 'Lack of general public access to finding easy meaning in data is a big barrier.', 41),
(181, 8, 1, 'degree to which the general public interacts with data in daily life', 'Jon Gosier', 'Data literacy will only really come when we are interacting with and learning about that tool and using it in our every day life, not just in school.  The more open and vibrant the data, the more people interact with it in daily life, the bigger the impact on overall education', 42),
(182, 8, 1, 'effectiveness of governance and service delivery', 'Jon Gosier', 'Vibrant data has a huge impact on service delivery by NGO’s and governments by allowing them to harness public information in near real time and make decisions  - For example Ushahidi has completely changed the field of large scale disaster response by allowing the public to participate in widespread data gathering and helping make sense of those data in near real time.', 43),
(183, 8, 1, 'art', 'Jon Gosier', 'Vibrant Data could have a huge positive impact on art by democratizing technology  to create, publish, and share art.', 44),
(184, 8, 1, 'legal framework for open distribution and remixing of creative content', 'Jon Gosier, Julianna Rotich', 'One barrier to the creative potential of Vibrant Data in the arts and other creative endeavors are legal restrictions to what constitutes original content. Creative Commons licensing.', 45),
(185, 8, 1, 'degree to which underlying technologies and data are invisible', 'Jon Gosier, James Patten, Erik Hersman, Andrew Blau, John Batelle', 'Big enabler to data-driven entrepreneurship is the abilty to have technologies that hide the complexity and let people intuitively go about their business', 46),
(186, 8, 1, 'ability of tools to be highly customizable', 'Jon Gosier, Julianna Rotich', 'Vibrant Data tools are really complex because they must be highly customizable for specific local needs while also meeting universal needs', 47),
(187, 8, 1, 'ability to collaboratively curate and filter data', 'Julianna Rotich, Faisal Chohan', 'One key enabler is to enable collaborative sifting of information. Like Swift River Project – this is key for dealing with the overwhelming amount of data.  Human filters, not just algorithms. When the source data is unreliable, the best way to clean it is to open it up and enable many people to check credibility, make corrections, and build the ecosystem of data.', 48),
(188, 8, 1, 'proportion of Government data that is accessible', 'Erik Hersman, Faisal Chohan, Emeka Okafor', 'In Africa, the Middle East, Pakistan - the majority of information is held by the government. So a huge challenge is just opening that up in an accessible format to be the foundation of the data ecosystem. Other apps and services get built on top of that, and that generates more data. But the foundation is that basic layer of open data from the government', 49),
(189, 8, 1, 'degree of access to small screens and non-smart phones', 'Erik Hersman', 'In Africa and many places, the main mode of internet access is not laptop or smartphone but basic cell phone w small screen', 50),
(190, 8, 1, 'ease with which people can actively contribute data', 'Erik Hersman', 'Not personal data from searches or purchases, but active generatio of data like crisis mapping, disaster mapping, or identifying border check points or bad roads. How to best enable the eyes and ears of the population to sense and communicate important things in real time that have implications for policy, security, safety, etc.', 51),
(191, 8, 1, 'tools to make existing government data that is open actually accessible', 'Erik Hersman', 'In Africa the majority of public information is held by the government. The first basic step is how to open that up in a framework that is accessible and easily updateable? Main players helping here are Govt, Big corporations (Google, Microsoft, Nokia), and the Tech developer community', 52),
(192, 8, 1, 'inclusion of basic SMS data', 'Erik Hersman', 'people get caught up in the shiny widgets and applications – but they forget that SMS is also data that can be enormously useful and powerful to change the world from the bottom up', 53),
(193, 8, 1, 'proportion of the population motivated to give back in their spare time for free', 'Erik Hersman', 'Many open source projects and movements – anything that involves collaborative value creation – requires a certain seed of people who find value in doing something useful and productive in their spare time for free.  Like Wikipedia. Importace of the power of people’s ‘spare cycles’ and the love of doing stuff to make the world a better place', 54),
(194, 8, 1, 'enabling people to act on things that directly affect them', 'Erik Hersman', 'Key to engaging not just the small minority of active tech people, but the 80% of ordinary people is to focus on things that affect them directly. People care about the pothole on their street but not 2 streets over.  By focusing on those points of direct need, we can vastly increase participation.  Direct feedback between data generation and meeting needs.  When dealing with anything with open data and ordinary people, incentives matter, and people are most incentivized when directly affected.', 55),
(195, 8, 1, 'legal frameworks for sharing public government data', 'Erik Hersman', 'In Africa and elsewhere, a huge barrier to vibrant data has been getting govt policy, or even people in government to open up and share public data.  These barriers are being overcome by coalitions driving change – the World Bank, Google, the Web Foundation.', 56),
(196, 8, 1, 'availability of basic read-write platforms for hosting and sharing public data', 'Erik Hersman; Faisal Chohan', 'In some places where there are a lot of public data available, the key first step is a basic platform for making it easy to open up your data. Basic hosting services, etc.  \nIn many places, the foundation of the entire data ecosystem is simply making data available, and enabling users to share it, clean it, and add to it.', 57),
(197, 8, 1, 'visibility of small success stories and examples', 'Erik Hersman, Walid Al Saqaf, Emeka Okafor', 'Once people start seeing examples of how shared data is working in other places, it’s a lot easier to get them on board. They also get more ideas for how they could use it to benefit themselves. Once you have convinced a government or organization or company to open up their data, you’ve cleaned it and have the tools to update it, you have to immediately demonstrate that people will use it, and you need to immediately show individuals that they can benefit from it.  Need to seed momentum – create small successes. and spark imagination of what can be done.', 58),
(198, 8, 1, 'availability of tools to clean public data', 'Erik Hersman', 'Once government gets on board to open up public data, it’s a big challenge to clean what’s there to make it useful and relevant.', 59),
(199, 8, 1, 'availability of tools to keep public data updated in real time', 'Erik Hersman', 'Once government or other organizations open up their data, it has to be easy and seamless to make sure those data get continually updated.', 60),
(200, 8, 1, 'ability of people to be real time human sensor networks', 'Erik Hersman', 'Rather than personal data, crowds of people can be providing data in near real time about infrastructure needs, road conditions, service needs, leaky faucets and toilets, broken things that need fixing, etc.    This can apply to monitoring ecological data, invasive species, etc., urban infrastructure needs, and also rural communities needs in places where data from other sources are difficult to gather synchronously over large areas. Draw immediate connection between service providers and users.', 61),
(201, 8, 1, 'ability to convert data into action', 'Erik Hersman', 'People can provide information and data bout service or infrastructure needs, and that can draw attention to service providers. But a big challenge is converting the data into action.', 62),
(202, 8, 1, 'direct utility of open data to those giving it up', 'Faisal Chohan', 'One key way to convince goverments to open up data is if they can directly benefit from people filling gaps, cleaning the data, finding patterns and discrepancies, etc.  Compiling patterns of voting data in Pakistan is now being used by campaigns and politicians, not just citizens.  This is key not just for government data but also personal data.  The same is being applied to individuals - for example letting your phone track you because then you can track it if you lose it.', 63),
(203, 8, 1, 'ability to link news facts to real data', 'Faisal Chohan', 'A key revolution in open data will be enabling fact-checking of news stories by linking the stories to databases.', 64),
(204, 8, 1, 'quality of a reputation system', 'Michael K', 'Key to quality control and sharing is the ability to have reliable systems of aggregate trust and reputation.', 65),
(205, 8, 1, 'personal accountability', 'Michael K', 'One key to a better reputation system on the internet is actually making all users more accountable – When they for example use Facebook authentication, it keeps them more honest or makes them more careful about posting bad reviews since they are now accountable', 66),
(206, 8, 1, 'level of trust among participants', 'Michael K', 'all forms of participatory or collaborative value creation rely on trust as a core component', 67),
(207, 8, 1, 'proportion of real time data accessible by mobile phone', 'Andrew Blau', 'The biggest thing changing on the ground around the world is access to mobile phones.  6 billion phone subscriptions for 7 billion people on earth', 68),
(208, 8, 1, 'access to data from sensors vs people', 'Andrew Blau', 'A lot of data is not just coming from people, but actually sensors, satellite images, sensors on the street, etc.', 69),
(209, 8, 1, 'computational power of small devices', 'Andrew Blau', 'Increase in computational power especially for small devices will enable more real time exploration of patterns from data.', 70),
(210, 8, 1, 'ease of communicating about patterns', 'Andrew Blau', 'Connectivity and sharing is central – So people can find patterns in data, but how those insights are communicated and shared is critical.', 71),
(211, 8, 1, 'ability to control our ''data exhaust''', 'Andrew Blau', 'Critical need to understand how we navigate our own privacy and how we regain some control over all the personal data we generate', 72),
(212, 8, 1, 'tools to enable cooperative re-building and governance', 'Andrew Blau', 'Open data has made it easy to destabilize goverments, but not so easy to rebuild them.  If we don’t also enable cooperative re-building, then new governments are less likely to encourage open data?', 73),
(213, 8, 1, 'Ability to see under the hood of tools', 'Andrew Blau', 'While we need very simple intuitive interfaces, to hide the complexity from everyday people, those tools also need to be transparent, so that people are not deceived.  Google search is a good example. We don’t know what’s under the hood. So when they change their approach and just show local results or ones tailored to who they think we are, that’s dangerous if we don’t know it’s happening.', 74),
(214, 8, 1, 'Proportion of population actively using the internet', 'Walid Al Saqaf', 'Middle East has the highest growth rate of bandwidth usage. Basic access to information infrastructure is a big issue in the Middle East.', 75),
(215, 8, 1, 'Proportion of online information protected from censorship', 'Walid Al Saqaf', 'Censorship is a huge issue in the Arab world. Democracy and the internet have been very much connected. Most regimes have been opposed to open access to basic media.  Any new regimes can only survive if they have a clear open internet policy', 76),
(216, 8, 1, 'amount of data generated by people on the ground', 'Walid Al Saqaf', 'people as sensors. Active data that is collected, gathered by people on the ground, to be the eyes and ears of a city or a society. These are not personal data, but people as sensors and fact finders to overcome government censorship', 77),
(217, 8, 1, 'Clarity of motives for any Vibrant Data Platform', 'Walid Al Saqaf', 'People do things best and contribute best when they understand motives. And in this case the motives and needs will by highly context dependent – So it must be clear how this can be directly useful for very different types of people in different context.  Prototypes and examples are key', 78),
(218, 8, 1, 'ability to balance transparency vs privacy', 'Omar Wasow, Bre Pettis, Bill Joy, Jimmy Lin, Jean-Baptiste Michel, Cesar Harada, Esra', 'Transparency is this incredibly powerful tool for holding big institutions accountable.  But we also have to balance a desire for transparency with a respect for privacy of individual citizens. And what we’re now starting to see are some real tensions between a desire to bring transparency to our, uh, government, to our big institutions.  And at the same to balance that against a desire for privacy to respect for, uh, rights for people to withhold data', 79);
INSERT INTO `issues` (`id`, `projectId`, `userId`, `name`, `units`, `description`, `issueOrderNum`) VALUES
(219, 8, 1, 'privacy policy on expiration date for personal data', 'Omar Wasow, Jean-Baptiste Michel', 'How do we protect ourselves from having these data act as a permanent sentence that follows you everywhere you go for something you might have done say as a minor.  Or you might have done that, is ancient history. The tool that is a potential counter balance to this trend in the technology is laws and regulations that allow people to potentially have data expire after a certain amount of time. We need the opportunity to present a new version of ourselves with time. For example bankruptcy policy allows your data to no longer show up on a credit report.', 80),
(220, 8, 1, 'tools for novel statistical methods of pattern discovery', 'Ramana Rao', 'The better the computational power, the less we need to have a priori models in order to find patterns in data. Instead we can search through many classes of models to find new forms of discovery that are less limited by our pre-conceived ideas about how the world works.', 81),
(221, 8, 1, 'number of people empowered to ask questions of the entire system', 'Ramana Rao', 'Critical to balancing the good and bad of vibrant data is the abilty to enable more and more people to see patterns and question the system. What we are building is to complex for us to immediately understand. We need many perspectives and brains to see and anticipate and counter-act negative impacts.', 82),
(222, 8, 1, 'concentration of data power in few corporations', 'Raman Rao, John Batelle, Jean-Baptiste Michel', 'Big 5 – Microsoft, Amazon, Facebook, Google, Apple – they are intensely important – as both an opportunity or a major problem. Those consumer facing companies are extremely important for one reason, which is that they have direct relationships with hundreds of millions, if not billions, of human beings. The more narrow the control of the data, the more chance for unintended negative consequences.  But also the chance to implement far-reaching change.', 83),
(223, 8, 1, 'degree or danger of oversimplification', 'Ramana Rao', 'The danger of over-simplifying data science is greater than just narrative over simplification. Innumeracy is more dangerous than Illiteracy. For example, media over-simplification of climate change is a huge problem mostly because people don’t really understand how to evaluate data and evidence.', 84),
(224, 8, 1, 'enabling people to be the Vibrant Data Platform', 'Ramana Rao, John Batelle', 'No silver bullet tool, but anything that helps the audience be the media maker and the learner be an active learner. Educated people empower technology not the other way around.  \n When the individuals becomes the platform for data, as opposed to the platform being Facebook or Google or Apple, or a little app called Tidbit. But when the platform is the person and that person has all of their data at their disposal and understands the nuances and the instrumentation of that data.', 85),
(225, 8, 1, 'tools that enable vibrant communities around data', 'Ramana Rao', 'We need common places where data can be shared and there are some standards around it – Lke a Pinterest for vibrant data – Places that are not just cesspools of infographics but places that have vibrant communities around data', 86),
(226, 8, 1, 'connectivity of apps', 'John Batelle', 'Currently most apps are completely disconnected – there is no common navigational UI, you can’t share data among apps very easily.', 87),
(227, 8, 1, 'incentives for big companies to do good with data', 'John Batelle', 'Need to work with the Big 5 to use their power for good – There are huge incentives in Silicon Valley to do good – The bigger the company, the more someone working there thinks they have the potential to positively affect millions of people. That is what drives many people in Silicon Valley, not just money.', 88),
(228, 8, 1, 'immediate relevance to informal economies', 'Emeka Okafor', 'Most parts of the African economy reside in the informal economy. Vibrant data must be relevant to individuals on the ground in ways that matter to them if it is to have any real consequence.', 89),
(229, 8, 1, 'cultural relevance', 'Emeka Okafor', 'None of these tools will be useful if they are created by people with no real on the ground knowledge of what people really want – for example in Africa. Need to have input from the ground up on what are the needs.', 90),
(230, 8, 1, 'Ability to see broad trends and place ourselves in context', 'Jean-Baptiste Michel', 'Big data can help reveal trends, sentiments, and make them available to people on the ground. One huge enabler of the Arab Spring was people being able to see that they were not alone in their feelings.  Seeing the bigger picture empowered individuals to make a decision that would be risky without support of many.', 91),
(231, 8, 1, 'Ability to make smart decisions based on real time information', 'Jean-Baptiste Michel, Cesar Harada', 'As a consumer, when I go to a region, I should be able to make smarter decisions on the price of an apartment, negotiating a job offer, etc. The more people can have access to more locally specific information combined with broad context, the smarter they can be with their decisions. Same is true for service providers and basically any industry. Environmental change requires us to see impacts and effects in real time rather than in a report that surfaces 3 years later.', 92),
(232, 8, 1, 'legal framework for corporate Data Philanthropy', 'Jean-Baptiste Michel', 'Never before has so much knowledge about citizens been held by private firms. There is no framework for opening up corporate data.  Need a framework to enable “Data Philanthropy”', 93),
(233, 8, 1, 'incentives for large companies to open up data', 'Jean-Baptiste Michel', 'There are signs of individuals within companies trying to use people data for social good, but there are no larger incentives for the companies. If there were a good framework and incentives in place, large corporations could share data for social good. This may be one way to maintain security control while opening things up for social good.', 94),
(234, 8, 1, 'legal framework for anonymizing data', 'Jean-Baptiste Michel', 'There is no legal or ethical framework for protecting personal privacy by making their data anonymous', 95),
(235, 8, 1, 'tools for anonymization', 'Jean-Baptiste Michel,', 'It is currently very easy to de-anonymize personal data with info about zip code, date of birth, and gender.', 96),
(236, 8, 1, 'amount of data copyright protected', 'Jean-Baptiste Michel', 'Many forms of data, like newswires, are copyright protected, so we can’t use them to find patterns.', 97),
(237, 8, 1, 'personal control of own data', 'Jean-Baptiste Michel', 'If you can ‘own’ or control your data – you will be more likely to give it away for philanthropy', 98),
(238, 8, 1, 'ability to discriminate or prioritize data that should be open vs not', 'Cesar Harada', 'Some data needs to be open and some needs to be closed. We want data on the health of the ocean, but  maybe not data on making a hydrogen bomb.', 99),
(239, 8, 1, 'degree to which companies or governments have something to hide', 'Cesar Harada', 'Many corporations or governments do things or profit from activites that have externalities or negative impacts on society. The more they have things to hide, the less incentives they have to be transparent or open their data', 100),
(240, 8, 1, 'platform for connecting and relating different types of data', 'Cesar Harada', 'The value of data comes from having the ability to connect and synchronize different types and sources to find relationships. Pachube.com is a great example of a platform for connecting and relating data from many sensors – the internet of things.', 101),
(241, 8, 1, 'distributed platform innovation', 'Esra''a Al Shefei', 'Open source drives innovation as people build on what you made. It also allows it to be locally adapted and culturally relevant. The middle east is now a hub of innovation for open tools and platforms that are relevant to them, but then have wide use elsewhere. Things like anti-censorship tools, anti-corruption tools, tools that show local patterns of censorship, etc.', 102),
(242, 8, 1, 'government and corporate transparency', 'Esra''a Al Shefei', 'Vibrant data is exposing governments (and corporations) from the bottom up (e.g. crowdvoice)', 103),
(243, 8, 1, 'degree of openness in media', 'Esra''a Al Shefei', 'Media is playing a huge role in many countries to expose the government and empower and democratize the movement.  It also then become one of the biggest targets of censorship.', 104),
(244, 11, 1, 'first issue', 'w/p', 'issue description', 1);
