INSERT INTO `projects` (`id`, `name`, `url`, `description`, `question`, `numberOfIssuesPerParticipant`, `numberOfFromIssuesPerParticipant`, `projectState`, `video_embed`, `link_mapping_info`, `video_embed_link_mapping`, `admin_email`, `registration_message`) VALUES
(8, 'Vibrant Data Project', 'Vibrant-Data-Project', '<p><span>How can we make our personal data work for us and not against us? How can we enable global-scale &ldquo;Participatory Value Creation&rdquo; &nbsp;- where de-centralized, open access to data and the right tools help everyday people discover new meaning, new currencies, and new opportunity for creating value that wasn&rsquo;t there before &ndash; from micro-entrepreneurship to collective governance to human well-being?&nbsp; <br /></span></p>\n<p><span>The world is undergoing an explosion in the availability of digital data, a tremendous amount of it generated by technology users simply going about their daily lives.&nbsp; Much has been made about the degree to which corporations are&nbsp;<a href="http://www.fastcompany.com/magazine/160/tech-wars-2012-amazon-apple-google-facebook"><span>battling for control</span></a>&nbsp;of this ever-growing data-sphere. But this explosion has also created the opportunity for a more participatory approach to value creation, one not dominated by consumerism and big corporations. People are bringing tremendous entrepreneurial energy, and a renewed sense of community, to the use of their of personal assets (<a href="http://www.airbnb.com/"><span>AirBnb</span></a>;&nbsp;<a href="http://www.thredup.com/"><span>ThredUp</span></a>;&nbsp;<a href="http://www.parkatmyhouse.com/uk/"><span>Parkatmyhouse</span></a>); their skills and knowledge (<a href="http://www.quirky.com/"><span>Quirky</span></a>;&nbsp;<a href="http://www.thingiverse.com/"><span>Thingiverse</span></a>;&nbsp;<a href="http://www.udemy.com/"><span>Udemy</span></a>) and, most relevant, their personal data (<a href="https://pachube.com/"><span>Pachube</span></a>;&nbsp;<a href="http://www.patientslikeme.com/"><span>PatientsLikeMe</span></a>;&nbsp;<a href="http://www.quantifiedself.com/"><span>Quantified Self</span></a>).&nbsp;</span></p>\n<p><span>How can we enable massive expansion of these developments by lowering the barriers to entry and enabling more people to be creative without having to re-create the basic tools for finding new meaning and new opportunities for value creation?</span></p>\n<p><span>Are we talking about &ldquo;<a href="http://www.plosbiology.org/article/info:doi/10.1371/journal.pbio.1001195"><span>Open Data</span></a>&rdquo;? Not exactly. Most open data discussions do not address how individuals might selectively control the sharing of data for their own benefit. Are we talking about &ldquo;<a href="http://www.mckinsey.com/Insights/MGI/Research/Technology_and_Innovation/Big_data_The_next_frontier_for_innovation"><span>Big Data</span></a>&rdquo;? Not exactly. Although we are interested in how Big Data tools might be adapted to fit the needs of individuals and communities.&nbsp; Are we talking about&nbsp;<a href="http://www.collaborativeconsumption.com/the-movement/snapshot-of-examples.php"><span>Collaborative Consumption</span></a>? Yes, but somewhat more specific to the context of digital data creation and use.&nbsp;</span></p>\n<p><span>What shapes how people assume control of their personal data, and share it with others? How can ordinary people easily find meaning in large data sets? How are issues of data quality and personal security balanced against openness and fluidity? How can relatively lesser skilled individuals discover new pathways to value? What are the best ways to assign and accrue value to participants?</span></p>\n<div><span><br /></span></div>', '<p><span>Currently, most personal data is gathered by large institutions and corporations who keep it for their own purposes. We are interested in creating the capability for a much more decentralized approach &ndash; where individuals retain more control over their personal data, collaboratively discover its value and directly benefit from it. We would like your help in understanding how to make that possibility a reality.</span></p>\n<p>&nbsp;</p>\n<p><strong>What are 3-10 critical issues that either enable or constrain this decentralization of data control, use, and transformation into value?</strong></p>', 10, 3, 3, '<iframe src="http://player.vimeo.com/video/37546912?title=0&byline=0&portrait=0&color=588A9E&autoplay=1" width="800" height="450" frameborder="0" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe>', '<div><strong>PART 1</strong></div>\n<div>&nbsp;</div>\n<div>HI! THANKS FOR HELPING US MAP THE INTERCONNECTED CHALLENGES TO DEMOCRATIZING DATA.</div>\n<div>&nbsp;</div>\n<div>OUR GOAL is to enrich, diversify, and democratize the value created from the ecosystem of data that start and ends with us.&nbsp;Through input from a variety of experts, we have identified a core list of ~100 critical ''challenges'' (jobs that need to be done, problems that need solving, fundamental goals, and other ''moving parts'') that are essential for making our personal data work for us and not against us so that everyday people can benefit from the explosion of data about ourselves and our world. &nbsp;</div>\n<div>&nbsp;</div>\n<div>IN THIS PHASE you will help us map how each of these ''challenges'' directly influence each other.&nbsp;</div>\n<div>If one challenge is solved, is another one also solved? or does it get worse?</div>\n<div>&nbsp;</div>\n<div>From the network structure of this influence map, we are identifying a core hub of ''Grand Challenges'' that merit special creative attention for solving this bigger problem. You can see our first results based on input from about 50 experts on WeTheData.org</div>\n<div>&nbsp;</div>\n<div>WE REALIZE this is work, so we tried to make it as easy as possible. (We''re working on making it fun!).</div>\n<div>Please anticipate spending a couple hours to complete - we deeply appreciate every minute of your time.</div>\n<div>&nbsp;</div>\n<div>WE WILL SHARE the results of this effort with you. We hope it will provide valuable insights that will empower you to empower a Vibrant Data revolution.</div>\n<div>&nbsp;</div>\n<div><strong>PART 2</strong></div>\n<div>&nbsp;</div>\n<div>HOW TO DO IT</div>\n<div>\n<div>&nbsp;</div>\n<ol>\n<li>SELECT a focal set of 10 issues that you will map all ''outgoing'' and ''incoming'' links to/from all other issues</li>\n<li>DRAW LINKS between any pair of issues (e.g., A and B) where a change in one causes a direct meaningful change in the other.\n<ul>\n<li>if a change in A causes a change in B, draw a link FROM A to B</li>\n<li>if a change in B causes a change in A, draw the reverse link FROM B to A.</li>\n<li>if A and B influence each other, draw a two way link.</li>\n</ul>\n</li>\n<li>GIVE EACH LINK A SIGN<br />\n<ul>\n<li>If an&nbsp;*increase* in A causes an *increase* in B, then they are positively correlated.&nbsp;<strong>(&uarr;)</strong></li>\n<li>If&nbsp;an *increase* in A causes a *decrease* in B, click they are negatively correlated.&nbsp;<strong>(&darr;)</strong></li>\n<li><strong></strong>(NOTE - most issues are phrased in such a way that ''increase'' = ''improvement'', but some are ambiguous)</li>\n</ul>\n</li>\n<li>ADD COMMENTS (OPTIONAL): If a link is strong but it strongly depends on something else, don''t hesitate to briefly describe why in the comments field!</li>\n<li>REPEAT for all the focal issues on your list</li>\n<li>You can always go back and edit links. Click the check box on each issue when it is complete.</li>\n</ol></div>\n<div>&nbsp;</div>\n<div>TIPS</div>\n<ul>\n<li>go with your gut, don''t over-think</li>\n<li>focus on direct influences that are stronger than average and relatively certain</li>\n<li>the quicker the better</li>\n</ul>\n<p><em><br /></em></p>', '<iframe src="http://player.vimeo.com/video/41297596?title=0&byline=0&portrait=0&color=588A9E&autoplay=1" width="800" height="450" frameborder="0" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe>', 'sundev@brainvise.com', '<p>A message about registration.</p>'),
(9, 'WebOfLife', 'WebOfLife', '', '<p>How can we harness collective expertise on species interactions in real systems?</p>', 0, 10, 2, '', '', '', 'sundev@brainvise.com', ''),
(11, 'a new project', 'a-new-project', '<p>This is what it''s about.</p>', '<p>What is this?</p>', 10, 0, 1, '', '<p>Draw some links.</p>', '', '', '');
