(3784, 8, 71, 121, 247, 'In some of the research I have seen, a lot of the hesitancy of sharing data is due to the amount of effort needed to effectively manage who our data is shared with. From opening several different email accounts and facebook profiles to using Tor to participate in alrger anonymous communities like Anonymous, this is in my opinion the most important hurdle to getting folks to create and share data.\n\nAlso, I think creating data is incredibly easy. Sharing data well is the hard thing to manage that is more interesting.', 1, '2012-05-07 10:15:32', 1, 1),
