(5627, 8, 71, 122, 173, 'Invisibility is the wrong way to think about the data, its collection and its transmission. Instead we need to think of integrating it seamlessly into activities.', -1, '2012-05-08 11:33:09', 1, 1),
(5629, 8, 71, 173, 156, '', -1, '2012-05-08 11:34:50', 1, 1),
(5630, 8, 71, 173, 192, '', -1, '2012-05-08 11:35:58', 1, 1),
(5631, 8, 71, 173, 223, 'Making data and its flows invisible makes it hard for people to ask for anonymizing sensitive data. Out of sight = out of mind which implies a level of anonymity and protection that is not there. ', -1, '2012-05-08 11:36:49', 1, 1),
(5632, 8, 71, 173, 230, '', -1, '2012-05-08 11:37:55', 1, 1);
INSERT INTO `userLinks` (`id`, `projectId`, `userId`, `issueFromId`, `issueToId`, `comment`, `sign`, `modified`, `num_observers`, `tot_observers`) VALUES
(5633, 8, 71, 173, 236, 'There needs to be a conceptual link between the collection and creation of data, its transmittal, and the management of its flow. Without it, users see this as an abstract problem that they ignore until something happens. Then the big rage explosion.', -1, '2012-05-08 11:38:04', 1, 1),
(5634, 8, 25, 121, 96, '', 1, '2012-05-08 11:39:02', 1, 1),
(5635, 8, 25, 121, 99, '', 1, '2012-05-08 11:39:08', 1, 1),
(5636, 8, 25, 121, 104, '', 1, '2012-05-08 11:39:18', 1, 1),
(5637, 8, 71, 173, 242, 'Invisibility prevents data from feeling like a resource. We need to be able to sense it subtly and have its collection, processing and transmission integrated seamlessly into our environment.', -1, '2012-05-08 11:39:35', 1, 1),
(5638, 8, 25, 121, 131, '', 1, '2012-05-08 11:39:49', 1, 1),
(5639, 8, 25, 121, 142, '', 1, '2012-05-08 11:40:09', 1, 1),
