(5644, 8, 25, 172, 121, '', 1, '2012-05-08 11:41:07', 1, 1),
(5645, 8, 71, 173, 245, 'Making data tangible helps people understand that it can be used to bring disparate folks together and form a community. By keeping it in the abstract it prevents folks from taking it into account.', -1, '2012-05-08 11:41:15', 1, 1),
